<!doctype html>
<html>
  <head>
    <meta http-equiv="Content-type" content="text/html; charset=utf-8" />
    <meta name="viewport" content="width=device-width" />
    <title>OfficeJS Router Gadget</title>
    <!-- renderjs -->
    <script src="rsvp.js" type="text/javascript"></script>
    <script src="renderjs.js" type="text/javascript"></script>
    <script src="gadget_officejs_router.js" type="text/javascript"></script>
  </head>
   <body>
    <script data-renderjs-configuration="configuration_manifest" type="text/x-renderjs-configuration">gadget_officejs_jexcel_editor.configuration</script>
    <script data-renderjs-configuration="parent_portal_type" type="text/x-renderjs-configuration">Jexcel Sheet Module</script>
    <script data-renderjs-configuration="parent_relative_url" type="text/x-renderjs-configuration">jexcel_sheet_module</script>
    <script data-renderjs-configuration="portal_type" type="text/x-renderjs-configuration">Jexcel Sheet</script>
    <script data-renderjs-configuration="portal_skin_folder" type="text/x-renderjs-configuration">erp5_officejs_jexcel</script>
    <script data-renderjs-configuration="app_actions" type="text/x-renderjs-configuration">('Jexcel Sheet Module | jexcel_editor_view', 'Jexcel Sheet | jexcel_editor_view', 'Jexcel Sheet | jexcel_editor_clone')</script>
    <script data-renderjs-configuration="app_allowed_sub_types" type="text/x-renderjs-configuration">('Jexcel Sheet Module | Jexcel Sheet',)</script>
    <script data-renderjs-configuration="jexcel_sheet_module_dict" type="text/x-renderjs-configuration">{"title": "Jexcel Sheets", "filter_action": 1, "hide_add_button": 0, "history_previous_link": 1}</script>
    <script data-renderjs-configuration="jexcel_sheet_dict" type="text/x-renderjs-configuration">{"title": "Jexcel Sheets", "editable": 1, "history_previous_link": 1}</script>
    <script data-renderjs-configuration="app_view_reference" type="text/x-renderjs-configuration">jexcel_editor_view</script>
    <div data-gadget-url="gadget_erp5_router.html" data-gadget-scope="erp5_router"></div>
  </body>


</html>
